import React from 'react';

const Galerie = () => {
  return (
    <section id="galerie" className="bg-gradient-to-b from-yellow-300 via-yellow-300 to-yellow-400 p-10 min-h-screen">
      <h2 className="text-center text-3xl font-bold text-black mb-8">Galerie</h2>
      <div className="grid grid-cols-2 md:grid-cols-3 gap-4">
        <div className="bg-white bg-opacity-60 h-40 rounded-md"></div>
        <div className="bg-white bg-opacity-60 h-40 rounded-md"></div>
        <div className="bg-white bg-opacity-60 h-40 rounded-md"></div>
        <div className="bg-white bg-opacity-60 h-40 rounded-md"></div>
        <div className="bg-white bg-opacity-60 h-40 rounded-md"></div>
        <div className="bg-white bg-opacity-60 h-40 rounded-md"></div>
      </div>
    </section>
  );
};

export default Galerie;
